(1194,	1,	1,	'2,19,24,26,27,28',	'2,19,24,26,27,28',	'',	'sayuran_segar',	'PRD1170',	'',	'Sawi Pahit',	1.00,	0.25,	0.00,	0.00,	1,	1,	2,	2,	'Sawi pahit mengandung antioksidan yang dapat membantu meningkatkan kekebalan tubuh dan mencegah terjadinya kanker. Selain kaya akan serat, sawi pahit juga dikenal mengandung vitamin B1, B2, B6, C, dan E. Cara penyimpanannya cukup mudah, jangan mencuci sawi pahit lebih dulu jika tidak ingin langsung dimasak. Lebih baik dibungkus dengan kertas lalu dimasukan ke kulkas pada rak sayur. ',	'',	1),
(1195,	3,	11,	'2,24,26',	'2,24,26',	'2,24,26',	'bahan_pangan_olahan',	'PRD1171',	'',	'Oncom (0.3-0.4 kg/pcs)',	0.40,	1.00,	0.00,	0.00,	1,	1,	1,	2,	'Oncom salah satu makanan khas Indonesia yang paling populer di Jawa Barat. Oncom adalah bungkil kacang atau bisa juga ampas tahu. Cara menyimpan oncom bisa dengan menempatkan oncom dalam wadah kering dan tertutup sebelum dimasukkan ke kulkas. Menyimpan oncom di kulkas bisa membuat oncom tahan paling tidak 1-3 hari.',	'',	1),
