(1198,	3,	1,	'19,27,28',	'19,27,28',	'',	'sayuran_segar',	'PRD1174',	'',	'Sawi Putih Kecil (0.8-1.1 kg/pcs)',	1.10,	1.00,	0.00,	0.00,	1,	1,	2,	2,	'Sawi putih mengandung beragam vitamin dan mineral, seperti vitamin A, B1, B2, B3. B6. B9, C, E, K, kalsium, kalium, magnesium, fosfor, zat besi, zinc, dan natrium. Agar tahan hingga dua bulan, simpan sawi putih utuh dengan dibungkus menggunakan kantong plastik bersih di dalam kulkas. ',	'',	1),
(1199,	1,	1,	'2,19,24,26,27,28',	'2,19,24,26,27,28',	'27,28,19',	'sayuran_segar',	'PRD1175',	'',	'Tomat Sayur (18-20 pcs/kg)',	1.00,	0.25,	0.00,	0.00,	1,	1,	1,	2,	'Kandungan vitamin C dan antioksidan di dalam tomat bisa menangkal radikal bebas penyebab kanker. Tomat yang masih segar sebaiknya disimpan pada suhu ruang 13-21C dengan posisi pangkal tangkai tomat berada di bawah untuk mencegah masuknya oksigen sehingga kesegaran tomat lebih terjaga. Tomat yang terlalu matang sebaiknya disimpan dalam kulkas dengan memasukkannya dalam plastik atau wadah tertutup. ',	'',	1),
(1200,	2,	19,	'19,27,28',	'19,27,28',	'27,28,19',	'bumbu_dapur',	'PRD1176',	'',	'Tepung Crispy Cap Kriuk 150 gr',	0.15,	1.00,	0.00,	0.00,	1,	1,	1,	2,	'Tepung krispy cap kriuk adalah tepung bumbu serba guna yang diolah menggunakan bahan dasar tepung terigu yang dicampur dengan lada, pengembang makanan, bawang putih, penyedap rasa dan garam sehingga menjadi tepung bumbu serba guna yang pas untuk berbagai kreasi masakan dengan rasanya yang enak dan renyah',	'',	1),
(1201,	7,	19,	'19,27,28',	'19,27,28',	'19,27,28',	'bumbu_dapur',	'PRD1177',	'',	'Asem Jawa Kemasan (5 pcs/renceng)',	0.07,	1.00,	0.00,	0.00,	1,	1,	1,	2,	'Asem jawa yang diolah menjadi minuman bisa menyehatkan saluran perncernaan. Karena asam jawa bisa menetralkan frekuensi buang air besar. Minum asem jawa bisa membuat proses BAB menjadi lebih lancar (efek laksatif). Namun, ketika diare, asem jawa bisa menahan proses buang air yang terlalu sering. Asem jawa juga bisa digunakan untuk campuran sayur asem dan ikan yang direndam sebelum digoreng. Cara menyimpan asem jawa lebih baik dimasukan di dalam kulkas agar bisa bertahan lama. ',	'',	1),
(1202,	1,	22,	'19,27,28',	'19,27,28',	'28,19',	'cabai_&_bawang',	'PRD1178',	'',	'Bawang Merah Nganjuk',	1.00,	0.25,	0.00,	0.00,	1,	1,	1,	2,	'Bawang merah nganjuk merupakan persilangan bawang lokal dengan ciri bentuk bawangnya bulat dengan aroma yang enak!',	'',	1),
(1203,	1,	22,	'19,27,28',	'19,27,28',	'',	'cabai_&_bawang',	'PRD1179',	'',	'Bawang Merah Besar Nganjuk',	1.00,	0.25,	0.00,	0.00,	1,	1,	2,	2,	'Bawang merah bisa menambahkan rasa lezat pada masakan. Dapat digunakan dalam keadaan segar, sebagai produk sayuran acar, bumbu tumisan, hingga jadi taburan bawang goreng. Simpang bawang merah ditempat yang kering dan terbuka untuk menghindari pembusukan lebih cepat.',	'',	1),
(1204,	10,	22,	'19,27,28',	'19,27,28',	'27,28',	'cabai_&_bawang',	'PRD1180',	'',	'Bawang Merah Nganjuk Abres (24-25 kg/karung)',	25.00,	1.00,	0.00,	0.00,	1,	1,	1,	2,	'Bawang merah ini bukan hanya penyedap rasa saja. Tapi bisa menambahkan rasa lezat pada masakan. Bawang merah ini memiliki banyak kandungan yang bermanfaat untuk kesehatan seperti sodium, kalium, folat, vitamin A, C, dan E, kalsium, magnesium, fosfor, dan nutrisi lainnya.  ',	'',	1),
