(1206,	1,	7,	'2,24,26',	'2,24,26',	'',	'buah_segar',	'PRD1182',	'',	'Manggis',	1.00,	0.50,	0.00,	0.00,	1,	1,	2,	2,	'Buah manggis mengandung vitamin C dan serat yang keduanya penting untuk sistem kekebalan tubuh manusia. Vitamin C memiliki sifat antioksidan serta berperan untuk meningkatkan fungsi sel kekebalan, sehingga dapat mengurangi risiko penyakit. ',	'',	1),
(1207,	1,	1,	'2,24,26',	'2,24,26',	'2,24,26',	'sayuran_segar',	'PRD1183',	'',	'Okra Hijau',	1.00,	0.25,	0.00,	0.00,	1,	1,	1,	2,	'Okra hijau merupakan tanaman sejenis kapas yang dapat dikonsumsi hingga bagian bijinya. Tanaman berbentuk lonjong ini merupakan salah satu jenis sayuran yang bebas lemak.  Okra kaya serat, sehingga menciptakan rasa kenyang, dan mencegah penambahan berat badan. ',	'',	1),
