(1209,	2,	19,	'10,22,31',	'10,22,31',	'22,31,10',	'bahan_pangan_olahan',	'PRD1185',	'',	'Beras Premium Sania (5 kg/pack)',	5.00,	1.00,	0.00,	0.00,	1,	1,	1,	2,	'Sania Beras Premium hasil teknologi Jepang yang menghasilkan beras putih alami, bersih dan tidak berbau. Beras Saniayang telah memenuhi standardberaspremium dengan maksimum patahan 15%, menghasilkannasiyang sangat pulen. Beras ini sebaiknya disimpan di wadah yang tertutup rapat agar terjaga kelembaban, udara, dan menghindari hama masuk ke dalam.',	'',	1),
(1210,	1,	1,	'7,11,19,20,23,25,27,28',	'7,11,19,23,25,27,28',	'23',	'',	'PRD1186',	'',	'Tomat Grade C',	1.00,	0.25,	0.00,	0.00,	1,	1,	1,	2,	'Tomat grade C memiliki warna merah kehijauan. Tomat termasuk sayuran buah yang banyak digemari, karena mempunyai rasa yang enak, segar, dan sedikit asam. Tomat yang terlalu matang sebaiknya disimpan dalam kulkas dengan memasukkannya dalam plastik atau wadah tertutup. Beli tomat berkualitas di Eden Farm!',	'',	1),
