(1213,	1,	7,	'2,24,26',	'2,24,26',	'2,24,26',	'buah_segar',	'PRD1189',	'',	'Mangga Kweni',	1.00,	0.25,	0.00,	0.00,	1,	1,	1,	2,	'Satu buah mangga kweni mengandung vitamin A yang berguna untuk mencegah gangguan mata hingga meningkatkan daya tahan tubuh selama kehamilan. Mangga kweni juga kaya akan vitamin B6 yang bisa meningkatkan sistem imunitas, bahkan dapat membantu proses pertumbuhan dan perkembangan sel janin dalam kandungan.',	'',	1),
