(1218,	1,	13,	'7,11,2,19,10,22,20,23,24,25,26,27,28,31',	'7,11,2,19,10,22,20,23,24,25,26,27,28,31',	'20',	'telur_daging_ikan',	'PRD1194',	'',	'Telur Ayam Putih/Kecil',	1.00,	0.25,	0.00,	0.00,	1,	1,	1,	2,	'Cangkang telur putih ini terbuat dari kalsium karbonat berwarna putih tidak mengandung pigmen. Menyimpan telur dengan suhu rendah dan stabil seperti di lemari es bisa menjaga kualitas telur, namun jangan terlalu lama karena justru bisa memperburuk kualitasnya juga.',	'',	1),
