(1343,	2,	13,	'2,7,11,10,19,31',	'2,7,11,10,19,31',	'2,11,7',	'telur_daging_ikan',	'PRD1319',	'',	'Ikan Dori FIllet Glazing (0,4-0,5 kg/pack)',	0.50,	1.00,	0.00,	0.00,	1,	1,	1,	2,	'Pengemasan ikan dori dilakukan dengan proses produksi yang higienis dan quality control terstandar, serta proses pembekuan yang tetap mempertahankan kualitas gizi dan nutrisinya.\nSelain mengandung protein dan asam amino esensial tinggi, ikan dori juga mengandung lisin dan arginine yang lebih tinggi dibanding protein susu dan daging.',	'',	1),
(1344,	2,	13,	'2,7,10,11,19,31',	'2,7,10,11,19,31',	'7,11',	'telur_daging_ikan',	'PRD1320',	'',	'Udang Vanname Cooked (0,4 - 0,5 kg/pack)',	0.50,	1.00,	0.00,	0.00,	1,	1,	1,	2,	'Udang Vanname cooked dikemas dalam kondisi beku dan bersih dari kulit, kepala, serta ekor. Proses pre-cooked (cooked) sudah dilakukan agar udang tahan lama dan kualitas tetap terjaga. Kandungan kalsium, potasium, dan fosfor yang merupakan sumber vitamin A dan E, serta asam lemak omega 3 dalam udang baik untuk menutrisi tubuh. Ketika udang diterima dan belum akan digunakan, segera bekukan kembali.  Kandungan alergen pada udang bisa memicu alergi, jadi konsumsi secara bijak, ya.',	'',	1),
