(1373,	1,	1,	'7,11',	'7,11',	'',	'sayuran_segar',	'PRD1349',	'',	'Tomat Grade B',	1.00,	1.00,	0.00,	15.00,	1,	1,	2,	2,	'Warna tomat grade B merah dan belang dipengaruhi tingkat kematangannya, ukurannya juga besar dan kecil sehingga bentuknya bulat tidak seragam. Kualitasnya mungkin tidak sebagus tomat grade A dan A+ karena terdapat sedikit luka alam di bagian sisinya, tetapi gak perlukhawatir kondisi tomat ini masih bagus dan layak dikonsumsi, kok.',	'',	1),
(1374,	1,	1,	'7,11',	'7,11',	'7,11',	'sayuran_segar',	'PRD1350',	'',	'Timun Grade B',	1.00,	0.50,	0.00,	10.00,	1,	1,	1,	2,	'Meski bentuk timun grade B bervariasi sehingga tidak simetris seperti timun grade A dan A+ serta terdapat sedikit luka mekanis saat proses pemetikan, Sahabat Eden gak perlu khawatir karena itu tidak mengurangi kualitas timun di dalamnya.',	'',	1),
(1375,	1,	1,	'7,11,2,19,10',	'7,11,2,19,10',	'7,11',	'sayuran_segar',	'PRD1351',	'',	'Sawi Putih Grade B',	1.00,	0.50,	0.00,	15.00,	1,	1,	1,	2,	'Cuma  karena  ukurannya  lebih  kecil makanya  sawi  ini  masuk  kategori  grade B.  Kualitasnya? Tenang, tetap bagus! Bentuknya tetap utuh memanjang dan tidak terdapat daun yang patah atau berwarna coklat akibat luka goresan atau tertekan.',	'',	1),
(1376,	1,	1,	'2,7,11,19,10',	'2,7,11,19,10',	'',	'sayuran_segar',	'PRD1352',	'',	'Labu Siam Besar Grade B ',	1.00,	0.50,	0.00,	10.00,	1,	1,	2,	2,	'Yuk,  beli  labu  siam  grade  B! Bukannya  jelek?  Tenang,  kualitas  daging  labu  siam tetap  bagus meskipun ada sedikit goresan dan memar di permukaannya. Ukurannya juga bervariasi ada yang lebih kecil dan lebih besar dibanding labu siam standar, lho!',	'',	1),
(1377,	1,	1,	'2,7,10,11,19',	'2,7,10,11,19',	'',	'sayuran_segar',	'PRD1353',	'',	'Buncis Grade B',	1.00,	0.50,	0.00,	10.00,	1,	1,	2,	2,	'Nutrisi buncis grade B dengan grade A dan A+ tetap sama hanya saja buncis grade B warnanya tidak merata, ada yang hijau keseluruhan dan ada hijau yang terdapat bintik hitam. Tetapi bintik hitam ini hanya sedikit di beberapa sisi buncis jadi masih aman untuk dikonsumsi.',	'',	1),
(1378,	1,	1,	'2,7,10,11,19',	'2,7,10,11,19',	'',	'sayuran_segar',	'PRD1354',	'',	'Terong Ungu Grade B',	1.00,	0.50,	0.00,	10.00,	1,	1,	2,	2,	'Kualitas terong ungu grade B tidak kalah dengan grade A dan A+, lho! Meski warna ungunya tidak merata, tetapi kondisi terong utuh tidak patah, tidak bolong, dan tidak busuk. Bentuk terong juga tidak mengerut atau benyek jadi masih layak untuk dikonsumsi, ya, Sahabat Eden.',	'',	1),
(1379,	1,	1,	'2,7,10,11,19',	'2,7,10,11,19',	'7,11',	'sayuran_segar',	'PRD1355',	'',	'Wortel Grade B',	1.00,	0.50,	0.00,	10.00,	1,	1,	1,	2,	'Ada sedikit goresan di permukaan wortel tetapi daging wortelnya tetap dalam kondisi baik, ya. Tekstur wortel grade B tidak lembek dan tidak busuk jadi Sahabat Eden jangan ragu beli wortel grade B karena meski tak sesempurna grade A dan A+ nutrisinya tetap terjaga, kok.',	'',	1),
(1380,	1,	1,	'2,7,10,11,19',	'2,7,10,11,19',	'',	'sayuran_segar',	'PRD1356',	'',	'Jagung Manis Grade B',	1.00,	0.50,	0.00,	10.00,	1,	1,	2,	2,	'Jagung manis grade B lengkap dengan kulitnya sehingga meski terdapat sedikit luka pada bagian kulit jangung tidak akan merusak kualitas jagung di dalamnya. Dibanding grade A dan A+ ukurannya cenderung lebih kecil sekitar <17 cm. Jadi, kalau Sahabat Eden pengin jagung ukuran lebih kecil jangan ragu beli jagung manis grade B, ya, karena kondisinya masih OK!',	'',	1),
(1381,	1,	1,	'2,7,10,11,19',	'2,7,10,11,19',	'',	'sayuran_segar',	'PRD1357',	'',	'Kacang Panjang Grade B',	1.00,	0.50,	0.00,	5.00,	1,	1,	2,	2,	'Kualitas kacang panjang grade B sebenarnya masih bagus, memang tidak sebagus grade A dan A+ karena ada sedikit  patahan  dan  spot  hitam  di  sisinya,  tetapi masih  baik  untuk  dikonsumsi,  kok, Sahabat Eden.',	'',	1),
(1382,	1,	1,	'2,7,10,11,19',	'2,7,10,11,19',	'',	'sayuran_segar',	'PRD1358',	'',	'Daun Bawang Grade B',	1.00,	0.50,	0.00,	10.00,	1,	1,	2,	2,	'',	'',	1),
(1383,	1,	1,	'2,7,10,11,19',	'2,7,10,11,19',	'11,7',	'sayuran_segar',	'PRD1359',	'',	'Kol Grade B',	1.00,	0.50,	0.00,	10.00,	1,	1,	1,	2,	'Warna kol putih grade B memang tidak secerah kol putih grade A dan A+ dan meski ada sedikit bolongan di bagian luarnya, kondisi kol putih masih bagus, lho! Bentuknya bulat pipih dan Sahabat Eden bisa pilih ukurannya karena tersedia ukuran kecil dan besar.',	'',	1),
